import React, {FC} from 'react';
import {IBookedTrip, ITrip} from "../../../types/types";
import BookingComponent from "../../common/BookingComponent/BookingComponent";

interface IPropTypes {
    trips: IBookedTrip[],
    deleteBooking: (s:string) => void}

const Bookings:FC<IPropTypes> = ({trips, deleteBooking}) => {
    return (
        <main className="bookings-page">
            <h1 className="visually-hidden">Travel App</h1>
            <ul className="bookings__list">
                {trips.map(trip => <BookingComponent key={trip.id} booked={trip} deleteBooking={deleteBooking}/>)}
            </ul>
        </main>
    );
};

export default Bookings;
